def minPath(grid, k):
    n = len(grid)
    if n < 2:
        return []

    # Find the starting cell with value 1
    for i in range(n):
        for j in range(n):
            if grid[i][j] == 1:
                start_row, start_col = i, j
                break

    # Define helper function to get neighbors
    def get_neighbors(row, col):
        neighbors = []
        if row > 0:
            neighbors.append((row - 1, col))
        if row < n - 1:
            neighbors.append((row + 1, col))
        if col > 0:
            neighbors.append((row, col - 1))
        if col < n - 1:
            neighbors.append((row, col + 1))
        return neighbors

    # Perform BFS to find the minimum path
    queue = [(start_row, start_col, [grid[start_row][start_col]])]
    visited = set()
    while queue:
        row, col, path = queue.pop(0)
        if len(path) == k:
            return path
        visited.add((row, col))
        neighbors = get_neighbors(row, col)
        for neighbor_row, neighbor_col in neighbors:
            if (neighbor_row, neighbor_col) not in visited:
                new_path = path + [grid[neighbor_row][neighbor_col]]
                queue.append((neighbor_row, neighbor_col, new_path))

    return []

